import VideoBgSection from "../Components/videoBgSection.jsx";
import SectionWithImg from "../Components/sectionWithImage.jsx";

function AboutUs() {
  return (
    <React.Fragment>
      <VideoBgSection />
      <SectionWithImg />
    </React.Fragment>
  );
}

export default AboutUs;
